import React from "react";
import { Container, Row, Col, Image } from "react-bootstrap";
import { HiChevronDoubleDown } from "react-icons/hi";

class Profiles extends React.Component {
  state = { show: "", field: "" };

  render() {
    return (
      <div>
        {this.props.user.map((users) => (
          <Container key={users.login.uuid}>
            {users.picture != null ? (
              <Row>
                <Col xs={6} md={4}>
                  <Image src={users.picture.large} roundedCircle />
                </Col>
                <p>{this.state.field}</p>
                <h3>{this.state.show}</h3>
              </Row>
            ) : (
              <Row>
                <Col xs={6} md={4}>
                  <Image src="holder.js/171x180" roundedCircle />
                </Col>
              </Row>
            )}
            <Row>
              <Col>
                <HiChevronDoubleDown
                  onMouseOver={() =>
                    this.setState({
                      show: users.login.password,
                      field: "My Passoword is:"
                    })
                  }
                />
              </Col>
              <Col>
                <HiChevronDoubleDown
                  onMouseOver={() =>
                    this.setState({ show: users.phone,
                    field: "My phone number is" })
                  }
                />
              </Col>
              <Col>
                <HiChevronDoubleDown
                  onMouseOver={() => this.setState({ show: users.location.street.name + " " + users.location.street.number,
                field: "My address is" })}
                />
              </Col>
              <Col>
                <HiChevronDoubleDown
                  onMouseOver={() => this.setState({ show: "My Passowrd is" })}
                />
              </Col>
              <Col>
                <HiChevronDoubleDown
                  onMouseOver={() => this.setState({ show: "My Passowrd is" })}
                />
              </Col>
              <Col>
                <HiChevronDoubleDown
                  onMouseOver={() => this.setState({ show: "My Passowrd is" })}
                />
              </Col>
            </Row>
          </Container>
        ))}
      </div>
    );
  }
}

export default Profiles;
